import{_ as e,o as t,c as o,a2 as r}from"./chunks/framework.DT_KUyqE.js";const _=JSON.parse('{"title":"不断学习 | 2022 年中总结","description":"","frontmatter":{"date":"2022-07-10T00:00:00.000Z","abstract":"工作节奏整体平稳。自己搭建了项目环境并投入生产环境使用；维护了一些老项目，修复了久远的隐藏 BUG (让屎山好了那么一丢丢)；归功于 Eslint 与阅读了更多代码，代码风格有了显著提升；做了很多关于文件上传下载的内容，对于 HTTP 协议有了更深入的了解。","tags":["阶段性总结"]},"headers":[],"relativePath":"posts/阶段性总结/不断学习2022年中总结.md","filePath":"posts/阶段性总结/不断学习2022年中总结.md","lastUpdated":1752400495000}'),s={name:"posts/阶段性总结/不断学习2022年中总结.md"};function l(i,a,n,d,p,c){return t(),o("div",null,a[0]||(a[0]=[r('<h1 id="不断学习-2022-年中总结" tabindex="-1">不断学习 | 2022 年中总结 <a class="header-anchor" href="#不断学习-2022-年中总结" aria-label="Permalink to &quot;不断学习 | 2022 年中总结&quot;">​</a></h1><h2 id="上半年的工作情况" tabindex="-1">上半年的工作情况 <a class="header-anchor" href="#上半年的工作情况" aria-label="Permalink to &quot;上半年的工作情况&quot;">​</a></h2><p>工作节奏整体平稳。自己搭建了项目环境并投入生产环境使用；维护了一些老项目，修复了久远的隐藏 BUG (<s>让屎山好了那么一丢丢</s>)；归功于 Eslint 与阅读了更多代码，代码风格有了显著提升；做了很多关于文件上传下载的内容，对于 HTTP 协议有了更深入的了解。</p><h2 id="年前目标完成情况" tabindex="-1">年前目标完成情况 <a class="header-anchor" href="#年前目标完成情况" aria-label="Permalink to &quot;年前目标完成情况&quot;">​</a></h2><p>今年 1 月底，我给自己定下了三个年度目标：</p><ol><li>体重减少至 61KG</li><li>学习完数据结构与算法，并刷完 500 道 leetcode</li><li>对自己的知识结构进行梳理，每月输出两篇相关的文章</li></ol><p>按照目前的进度来看，前两个目标大概率是完不成了。不过也算有所收获，首先相较去年，确实更健康了。其次读完了《数据结构与算法图解》，青岛大学-王卓老师的《数据结构与算法结构基础》看了 80P 左右。感觉目前自己对于理论的了解暂时足够了，需要更多去解题。</p><p>最后上半年输出的文章以 Vue 为主，主要是对业务开发中碰到的技术问题的思考。</p><h2 id="下半年目标" tabindex="-1">下半年目标 <a class="header-anchor" href="#下半年目标" aria-label="Permalink to &quot;下半年目标&quot;">​</a></h2><p>下半年的学习与实践我想主要以 Node 与 Vue3 为主，通过一两个完整项目来提升自己的技术水平。</p>',10)]))}const u=e(s,[["render",l]]);export{_ as __pageData,u as default};
